import React, { useEffect, useContext } from 'react';
import '../App.css';
import Title from './Title';

function Home(){

    useEffect(()=>{
        fetch("https://api.nasa.gov/planetary/apod?api_key=dcfPZkwMkY5KUH1mWniunfWRgvYZfeHhNQL7N1HC")
            .then(res=>res.json())
                .then(res=>{
                console.log(res);
                });
    })

    return(
        <div className="home">
            <Title/>
        </div>
    )
}

export default Home;
